        _swapTokensForEth(tokensToSwap);
        uint256 bal = address(this).balance - initialBal;
        (uint256 mTax, uint256 eTax) = _calculateSplit(bal);

        unchecked {
            _marketingTax += mTax;
            _eTFTax += eTax;
